function createTasksHtml(e){$.each(e,function(e,t){var n;switch(this.status_id){case 2:n="urgent";break;case 5:n="very_urgent";break;default:n="normal"}var r='<div id="d'+e+'" class="'+n+'"><input type="checkbox" id="c'+e+'" value="'+e+'" class="c_'+n+'"/> '+this.task+"</div>";$("#tasks").append(r)})};